  <div className="app__social">
    <div>
      <BsTwitter />
    </div>
    <div>
      <a href='https://www.facebook.com/profile.php?id=100008158209541' className='facebook_social'>
      <FaFacebookF />
      </a>
      
    </div>
    <div>
       <a href='https://instagram.com/ogelsby_barner?igshid=MzNlNGNkZWQ4Mg==' className='instagram_social'><BsInstagram /></a>
    </div>
  </div>
);

export default SocialMedia;
